column3:
Hey!

Está acontecendo em Brasilia o debate sobre a MP (Medida Provisória) 1147.

Para o setor de turismo e eventos, onde se encaixam os Parques de Diversões e Atrações Turísticas, essa é uma discussão importantíssima! 🤓

O SINDEPAT (@sindepat) - Sistema Integrado de Parques e Atrações Turísticas e a ADIBRA (@adibraoficial) - Associação das Empresas de Parques de Diversões do Brasil, estão a frente desse debate em prol do fortalecimento do setor de entretenimento e da manutenção de muitos empregos.

- O setor de Parques e Atrações Turísticas tem importante participação econômica e social e vem mostrando intensa recuperação. Por isso pedimos a aprovação do texto que trata do Perse na MP 1147, construído com intenso diálogo e sensibilidade.

As entidades e nós apoiamos:

- Voto 'Sim' para a continuidade do PERSE
- Voto 'Sim' ao texto da MP 1147 aprovado na câmara.

